import './App.css';
import Header from './components/header';
import Home from './components/home';
import About from './components/about';
import Services from './components/services';

function App(){
  return (
    <div>
      <Header/>
      <Home/>
      <About/>
      <Services/>
    </div>
  )
}

export default App;
